// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;

contract Core {

    mapping(bytes32 => address) private ecosystem_;

    // QS constructor calls loop to add all core contracts at deploy

    modifier onlyCore() {
        require(
            msg.sender == address(this),
            "Core: Only exes can modify"
        );
        _;
    }

    constructor(
        address[] memory _instances
    ) {

    }

    function getContract(bytes32 _key) external view returns(address) {
        return ecosystem_[_key];
    }

    function addContract(bytes32 _key, address _instance) external onlyCore() {
        require(
            ecosystem_[_key] == address(0),
            "Core: use update to replace"
        );
        _addContract(_key, _instance);
    }

    function updateContract(bytes32 _key, address _instance) external onlyCore() {
        _addContract(_key, _instance);
    }

    function execute(uint256 _propID) external {
        // TODO check proposal is valid for execution
        // (
        //     bool valid, 
        //     bytes32 exeID
        // ) = this.getContract(coreLib.coord).isPropExecutable(_propID);

        // TODO execute exe
    }

    // QS make internal function to add contracts

    function _addContract(bytes32 _key, address _instance) internal {
        ecosystem_[_key] = _instance;
    }
}

